import React from "react";

function Header() {
  return (
    <div class="header">
      <li class="navbar">
          <a id="header-content"><img rel="icon" href="makonisLogo" /> Makonis</a>
          <a id="home" href="./">Home</a>
      </li>
    </div>
  );
}

export default Header;


